INSERT INTO `knowledge_points` VALUES (7,'','','',0),(8,'','','',0),(9,'','','',0),(10,'什么是编译程序','#### 1\\. **定义与功能**\n\n-   **编译程序**是语言翻译程序，将**源语言**（如FORTRAN、C、Java等高级语言）转换为**目标语言**（如汇编语言、机器语言等低级语言），生成功能等价的程序。\n-   与**汇编程序**的区别：汇编程序将汇编语言翻译为机器语言。\n-   **黑盒模型**：输入为源程序，输出为目标程序（可能需进一步处理）。\n\n#### 2\\. **重要性**\n\n-   **屏蔽机器细节**：使程序员无需关注底层硬件差异，专注于逻辑设计。\n-   **跨平台性**：支持程序在不同机器上的移植（需配合不同目标语言的编译程序）。\n-   **开发效率**：提升软件开发的抽象层次。\n\n#### 3\\. **程序处理流程**\n\n典型的程序处理过程包括以下阶段（见图1.2）：\n\n1.  **预处理**：\n    -   合并多个源文件（如C语言的`#include`）。\n    -   宏展开（如C语言的`#define`）。\n2.  **编译**：\n    -   生成汇编代码（非最终机器码）。\n3.  **汇编**：\n    -   将汇编代码翻译为**可重定位机器代码**（Relocatable Machine Code）。\n4.  **链接/装配**：\n    -   连接库函数或其他模块（如C标准库）。\n    -   生成可执行机器代码。\n\n#### 4\\. **分类与类型**\n\n-   **趟数**：分**单趟编译**（一次扫描完成翻译）和**多趟编译**（多次扫描优化）。\n-   **功能扩展**：\n    -   调试编译程序：支持断点、变量跟踪。\n    -   优化编译程序：代码性能优化（如循环展开、指令调度）。\n\n#### 5\\. **发展历程**\n\n-   **20世纪50年代初**：首个编译程序出现，功能简单（仅支持单目运算）。\n-   **1950年代中期**：高级语言诞生（如FORTRAN），推动编译技术发展。\n-   **1950年代末**：研究编译程序自动生成工具（如LEX、YACC的前身）。\n\n#### 6\\. **自动生成工具**\n\n-   **LEX**：基于词法规则生成词法分析器。\n-   **YACC**：基于语法规则生成语法分析器。\n-   **现代工具链**：GCC、LLVM等集成预处理、编译、优化、链接全流程。\n\n* * *\n\n### 关键图示示意\n\n```plaintext\n图1.1 编译程序黑盒模型\n+----------------+          +-----------------+          +----------------+\n| 源程序         | 输入     | 编译程序        | 输出     | 目标程序       |\n| (高级语言)     | -------> | (黑盒)          | -------> | (低级语言)     |\n+----------------+          +-----------------+          +----------------+\n\n图1.2 程序处理流程\n源程序 → 预处理程序 → 编译程序 → 汇编程序 → 装配/连接程序 → 可执行机器代码\n```','',0),(11,'编译过程概述','编译程序完成从源程序到目标程序的翻译工作，是一个复杂的整体的过程。从概念上来讲，一个编译程序的整个工作过程是划分成阶段进行的，每个阶段将源程序的一种表示形式转换成另一种表示形式，各个阶段进行的操作在逻辑上是紧密连接在一起的，图1.3给出了一个编译过程的各个阶段，这是一种典型的划分方法，将编译过程划分成词法分析、语法分析、语义分析、中间代码生成、代码优化和目标代码生成6个阶段。\n下面通过源程序在不同阶段所被转换成的表示形式来介绍各个阶段的任务。\n1.词法分析\n词法分析是编译过程的第一个阶段。这个阶段的任务是从左到右一个字符一个字符地读入源程序，对构成源程序的字符流进行扫描和分解，从而识别出一个个单词(一些场合下也称单词符号或符号)。这里所谓的单词是指逻辑上紧密相连的一组\n字符，这些字符具有集体含义。例如，标识符是由字母字符开头，后跟字母、数字字符的字符序列组成的一种单词。保留字(关键字或基本字)是一种单词，此外还有算符、界符等。例如，某源程序片段如下：\nbegin var sum,first,count:real;sum :=first+count*10 end.\n词法分析阶段将构成这段程序的字符组成了如下单词序列：\n(2)保留字var  (3)标识符sum(1)保留字begin(4)逗号，(5)标识符first(6)逗号，(7)标识符count(9)保留字real(8)冒号：(11)标识符sum(12)赋值号：=(10)分号；(14)加号+    (15)标识符count(13)标识符first(17)整数10    (18)保留字end(16)乘号*\n(19)界符.\n可以看出，5个字符b、e、g、i和n构成了一个称为保留字的单词begin,两个字符：和=构成了表示赋值运算的符号：=。这些单词间的空格在词法分析阶段都被滤掉了。\n用id1、id2和id3分别表示sum、first和count这3个标识符的内部形式，那么经过词法分析后上述程序片段中的赋值语句sum :=first+count*10则表示为idl:=id2+id3*10。\n2.语法分析\n语法分析是编译过程的第二个阶段。语法分析的任务是在词法分析的基础上将单词序列分解成各类语法短语，如“程序”、“语句”、“表达式”等。这种语法短语也称为语法单位，可表示成语法树，比如上述程序段中的单词序列\nidl:=id2+id3*10\n经语法分析得知其是Pascal语言的赋值语句，表示成如图1.4所示的语法树或者如图1.5所示的简捷形式的语法树。语法分析所依据的是语言的语法规则，即描述程序结构的规则。通过语法分析确定整个输入串是否构成一个语法上正确的程序。\n程序的结构通常是由递归规则表示的，例如，可以用下面的规则来定义表达式：\n(1)任何标识符是表达式。\n(2)任何常数(整常数、实常数)是表达式。\n(3)若表达式1和表达式2都是表达式，那么:\n表达式1+表达式2\n表达式1*表达式2\n(表达式1)\n都是表达式。\n类似地，语句也可以递归地定义，如\n(1)标识符：=表达式是语句。\n(2)while(表达式)do语句\n和\nIf(表达式)then语句else语句都是语句。\n上述赋值语句idl:=id2+id3*10之所以能表示成图1.4所示的语法树，依据的是赋值语句和表达式的定义规则。\n词法分析和语法分析本质上都是对源程序的结构进行分析。但词法分析的任务仅对源程序进行线性扫描即可完成，比如识别标识符，因为标识符的结构是字母打头的字母和数字串，这只要顺序扫描输入流，遇到既不是字母又不是数字的字符时，将前面所发现的所有字母和数字组合在一起构成标识符单词即可。但这种线性扫描不能用于识别递归定义的语法成分，比如不能用此办法去匹配表达式中的括号。\n3.语义分析\n语义分析是审查源程序有无语义错误，为代码生成阶段收集类型信息。例如，语义分析的一个工作是进行类型审查，审查每个算符是否具有语言规范允许的运算对象，当不符合语言规范时，编译程序应报告错误。有的编译程序要对实数用作数组下标的情况报告错误。某些语言规定运算对象可被强制转换数据类型，那么当二目运算施于一个整型对象和一个\n实型对象时，编译程序应将整型对象转换成实型对象进行处理而不能认为是源程序的错误，假如在语句sum :=first+count*10中，count是实型，10是整型，则语义分析阶段进行类型审查之后，在语法分析所得到的分析树上增加一个语义处理结点inttoreal,表示整型10变成实型10.0的一目算符，则图1.5的树变成图1.6所示的树。\n4.中间代码生成\n在进行了上述的语法分析和语义分析阶段的工作之后，有的编译程序将源程序变成一种内部表示形式，这种内部表示形式叫做中间语言或中间代码。所谓\"中间代码”是一种结构简单、含义明确的记号系统，这种记号系统可以设计为多种多样的形式，重要的设计原则为两点：一是容易生成；二是容易将它翻译成目标代码。很多编译程序采用了一种近似“三地址指令”的“四元式”中间代码，这种四元式的形式为\n(运算符，运算对象1,运算对象2,结果):\n例如，源程序sum :=first+count*10可生成如图1.7所示的四元式序列，其中t₂(i=1,2,3)是编译程序生成的临时名字，用于存放运算的中间结果。5.代码优化\n这一阶段的任务是对前一阶段产生的中间代码进行变换或进行改造，目的是使生成的目标代码更为高效，即省时间和省空间。例如，图1.7的代码可变换为图1.8的代码，仅剩两个四元式而执行同样的计算。也就是说，在编译程序的这个阶段已经把将10转换成实型数的代码化简了，同时因为t₃仅仅用来将其值传递给idl,也可以被化简，这只是优化工作的两个方面；此外，诸如公共子表达式的删除、强度削弱、循环优化等优化工作将在第10章详细介绍。\n6.目标代码生成\n这一阶段的任务是把中间代码变换成特定机器上的绝对指令代码或可重定位的指令代码或汇编指令代码。这是编译的最后阶段，它的工作与硬件系统结构和指令含义有关，这个阶段的工作很复杂，涉及硬件系统功能部件的运用、机器指令的选择、各种数据类型变量的存储空间分配以及寄存器和后缓寄存器的调度等。\n例如，使用两个寄存器(R1和R2),可能将图1.8所示的中间代码生成如图1.9所示的某种汇编代码。第1条指令将id3的内容送至寄存器R2,第2条指令将其与实常数10.0相乘，这里用#表明10.0处理为常数，第3条指令将id2移至寄存器R1,第4条指令将R1和R2中的值相加，第5条指令将寄存器R1的值移到idl的地址中。\n上述编译过程的阶段划分是一个典型处理模式，事实上并非所有的编译程序都分成这样几个阶段，有些编译程序并不需要生成中间代码，有些编译程序不进行优化，即优化阶段可省去，有些最简单的编译程序在语法分析的同时产生目标指令代码，如1.4节介绍的PL/0语言编译程序。不过多数实用的编译程序都包含上述几个阶段的工作过程。\n\n\n\n\n\n\n\n\n','# 编译过程的阶段划分\n\n## 1\\. 词法分析\n\n### 任务描述\n\n-   从左到右扫描源程序字符流\n-   识别并分解出具有逻辑含义的单词（token）\n-   过滤空格等无关字符\n\n### 示例\n\n源程序片段：\n\n```pascal\nbegin var sum,first,count:real;sum :=first+count*10 end.\n```\n\n词法分析结果：\n\n```\n(1) 保留字begin   (2) 保留字var    (3) 标识符sum    \n(4) 逗号,        (5) 标识符first  (6) 逗号,        \n(7) 标识符count   (8) 冒号:        (9) 保留字real   \n(10) 分号;       (11) 标识符sum   (12) 赋值号:=    \n(13) 标识符first  (14) 加号+      (15) 标识符count \n(16) 乘号*       (17) 整数10      (18) 保留字end  \n(19) 界符.\n```\n\n## 2\\. 语法分析\n\n### 任务描述\n\n-   将单词序列分解为语法短语\n-   构建语法树表示程序结构\n-   验证语法正确性\n\n### 语法规则示例\n\n```bnf\n<表达式> ::= <标识符> \n          | <常数> \n          | <表达式> + <表达式>\n          | <表达式> * <表达式>\n          | ( <表达式> )\n\n<语句> ::= <标识符> := <表达式>\n         | while (<表达式>) do <语句>\n         | if (<表达式>) then <语句> else <语句>\n```\n\n### 语法树示例\n\n赋值语句 `id1 := id2 + id3 * 10` 的语法树：\n\n```\n       :=\n      / \\\n    id1  +\n        / \\\n      id2  *\n          / \\\n        id3 10\n```\n\n## 3\\. 语义分析\n\n### 任务描述\n\n-   类型检查与类型转换\n-   语义正确性验证\n-   添加语义处理节点\n\n### 示例处理\n\n当出现整型与实型运算时，添加类型转换节点：\n\n```\n       :=\n      / \\\n    id1  +\n        / \\\n      id2  *\n          / \\\n        id3 inttoreal\n                \\\n                 10\n```\n\n## 4\\. 中间代码生成\n\n### 四元式表示\n\n```text\n(1) (inttoreal, 10, _, t1)\n(2) (*, id3, t1, t2)\n(3) (+, id2, t2, t3)\n(4) (:=, t3, _, id1)\n```\n\n## 5\\. 代码优化\n\n### 优化后四元式\n\n```text\n(1) (*, id3, 10.0, t2)\n(2) (+, id2, t2, id1)\n```\n\n## 6\\. 目标代码生成\n\n### 汇编代码示例\n\n```assembly\nMOV R2, id3\nMUL R2, #10.0\nMOV R1, id2\nADD R1, R2\nMOV id1, R1\n```\n\n## 阶段特性总结\n\n阶段\n\n输入\n\n输出\n\n核心任务\n\n词法分析\n\n字符流\n\n单词序列\n\n单词识别与分类\n\n语法分析\n\n单词序列\n\n语法树\n\n结构验证与层次分解\n\n语义分析\n\n语法树\n\n带类型标注的语法树\n\n语义正确性验证与类型处理\n\n中间代码生成\n\n带标注的语法树\n\n四元式序列\n\n生成平台无关中间表示\n\n代码优化\n\n中间代码\n\n优化中间代码\n\n提高执行效率与资源利用率\n\n目标代码生成\n\n优化中间代码\n\n机器指令\n\n生成特定平台可执行代码',0),(12,'解释程序和一些软件工具','解释程序\n编译程序是一个语言处理程序，它把一个高级语言程序翻译成某个机器的汇编语言 程序或二进制代码程序，这个二进制代码程序在机器上运行以生成结果。因此通过编译 程序使得程序员可以先准备好一个在该机器上运行的程序，然后这个程序便会以机器的 速度运行。但是在不把整个程序全部翻译完成之后，这个程序是不能开始运行，也不能 产生任何结果的。编译和运行是两个独立分开的阶段。但在一个交互环境中，并不需要 将这两个阶段分隔开。这里介绍另一种语言处理程序，叫解释程序，它不需要在运行前 先把源程序翻译成目标代码，也可以实现在某台机器上运行程序并生成结果。\n解释程序接受某个语言的程序并立即运行这个源程序。它的工作模式是一个个的获 取、分析并执行源程序语句， 一 旦第 一 个语句分析结束，源程序便开始运行并且生成结果，它 特别适合程序员以交互方式工作的情况，即希望在获取下一个语句之前了解每个语句的执 行结果，允许执行时修改程序。\n著名的解释程序有BASIC语言解释程序、LISP 语言解释程序、UNIX 命令语言(shell) 解 释程序、数据库查询语言SQL 解释程序以及Java 语言环境中(见图1.15)的 BYTECODE 解释 程序 。\n图1. 11表示了解释程序的功能，图1. 12表示了编译程序和解释程序的不同工作 模 式 。\n解释程序的输入包括源程序和源程序的初始数据(输入数据),它不生成目标代码，直接\n\n\n\n输出结果。编译程序和解释程序的存储组织也有很大不同。经由编译程序处理时，在源程 序被编译的阶段，存储区中要为源程序(中间形式)和目标代码开辟空间，要存放编译用的各 种表格，如符号表。在目标代码运行阶段，存储区中主要是目标代码和数据，编译所用的任 何信息都不再需要了。\n解释程序一般是把源程序一个语句一个语句地进行语法分析，转换为一种内部表示形 式，存放在源程序区。例如，BASIC 解释程序将LET  和 GOTO  这样的关键字表示为一个 字节的操作码，标识符用其在符号表的入口位置表示。因为解释程序允许在执行用户程序 时修改用户程序，这就要求在解释程序工作的整个过程中，源程序、符号表等内容始终存放 在存储区中，并且存放格式要设计得易于使用和修改。\n图1.13和图1.14分别表示了编译程序的编译阶段、运行阶段以及解释程序的存储区 内容。\n程序的解释是非常慢的，有时一个高级语言源程序的解释会比运行等价的机器代码程 序慢100倍。因此当程序的运行速度非常重要时，是不能采用解释方式的。另外，解释程序 的空间开销也是比较大的。\n编译程序和解释程序是两类重要的高级语言处理程序。有些语言，如 BASIC 、LISP 和 Pascal  等，既有编译程序，也有解释程序。Java  语言的处理环境既有编译程序，也有解释程 序。图1. 15展示了Java 语言处理环境。\n处 理 源 程 序 的 软 件 工 具\n人们已经认识到，为了提高软件的开发效率和质量，需要有一套软件开发过程所遵循的 规范或标准，应使用先进的软件开发方法，并有相应的软件工具的支持。而这些软件工具的  开发，其中很多要用到编译的原理和技术。实际上，编译程序本身也是一种软件开发工具， 有了它们才能使用编程效率高的高级语言来编写程序。为了进一步提高编程效率，缩短调  试时间，软件工作人员研制了许多针对源程序处理的软件工具，这些工具首先要像编译程序  那样对源程序进行分析。下面是这些工具的一些例子。\n1. 语言的结构化编辑器\n用户可使用这种编辑器在语言的语法制导下编制出所需的源程序。结构化编辑器不仅 具有通常的正文编辑器的正文编辑和修改功能，而且还能像编译程序那样对源程序正文进 行分析。因此，结构化编辑器能够执行一些对正确编制程序有帮助的附加的任务。例如，它能够检查用户的输入是否正确，能够自动地提供关键字，当用户输入 if 后，编辑器立即显示  then  并将这两个关键字之间必须出现的条件留给用户输入，还能够检查 begin  或 左 括 号 与  end 或右括号是否相匹配等。由于结构化编辑器具有上述功能，既可保证编写出的源程序  无语法错误，并有统 一 的、可读性好的程序格式，这无疑将会提高程序的开发效率和质量。 这类商用产品很多，如 Turbo-Edit 、Editplus       和 Ultraedit     等。很多集成开发环境中里也都  包含这种类似的工具，如JBuilder 中 就 有Java 程序的结构化编辑器。\n2. 语言程序的调试工具\n调试是软件开发过程中的一个重要环节，结构化编辑器只能解决语法错误的问题， 而对一个已通过编译的程序来说，需进一步了解的是程序执行的结果与编程人员的意图 是否一致，程序的执行是否实现预计的算法和功能。这种算法的错误或者程序没能反映 算法的功能等问题就要用调试器来协助解决。有一种调试器允许用户使用源程序正文 和它的符号来调试，即一行一行地跟踪程序，查看变量和数据结构的变化以进行调试工 作。当然，这些符号的信息必须由编译程序提供。调试器的实现可以有很多途径。其中 一种是写一个解释器，以交互的方式翻译和执行每一行，它必须维护其所有的运行时的 资源以保证在程序执行期间可以很容易地查询不同变量的当前值。如果不通过解释手 段调试，而是在编译之后的代码上进行调试，编译程序必须在目标代码(汇编)生成时同 时生成特定的调试信息，例如，关联标识符和它表示的地址的信息，用于无歧义地引用 一  个声明了多次的标识符的信息等。调试功能越强，实现越复杂，它涉及源程序的语法分 析和语义处理技术。\n3. 程序格式化工具\n程序格式化工具分析源程序并以使程序结构变得清晰可读的形式打印出来。例如，注 释可以以 一 种专门的字形出现，且语句的嵌套层次结构可以用缩排方式(齿形结构)表示\n\n\n\n出 来 。\n4. 语言程序测试工具\n语言程序的测试工具有两种：静态分析器和动态测试器。\n静态分析器是在不运行程序的情况下对源程序进行静态分析，以发现程序中潜在的错 误或异常。它对源程序进行语法分析并制定相应表格，检查变量定值与引用的关系，如某变 量未被赋值就被引用，或定值后未被引用，或多余的源代码等一些编译程序的语法分析发现 不了的错误。\n动态测试工具也是首先对源程序进行分析，在分析基础上将用于记录和显示程序执行 轨迹的语句或函数插入到源程序的适当位置，并用测试用例记录和显示程序运行时的实际 路径，将运行结果与期望的结果进行比较分析，帮助编程人员查找问题。\n5. 程序理解工具\n程序理解工具对程序进行分析，确定模块间的调用关系，记录程序数据的静态属性和结 构属性，并画出控制流程图，帮助用户理解程序。\n6. 高级语言之间的转换工具\n由于计算机硬件的不断更新换代，更新更好的程序设计语言的推出为提高计算机的使 用效率提供了良好条件，然而一些已有的非常成熟的软件如何在新机器新语言情况下使用 呢?为了减少重新编制程序所耗费的人力和时间，就要解决如何把一种高级语言转换成另 一种高级语言，乃至汇编语言转换成高级语言的问题。这种转换工作要对被转换的语言进 行词法和语法分析，只不过生成的目标语言是另一种高级语言而已。这与实现一个完整的 编译程序相比工作量要少些。\n\n','',0),(13,'','','',0),(14,'数据结构的基本概念和术语','## 数据\n数据是信息的载体，是描述客观事物属性的数、字符及所有能输入到计算机中并被计算机程序识别和处理的符号的集合。数据是计算机程序加工的原料。\n## 数据元素\n数据元素是数据的基本单位，通常作为一个整体进行考虑和处理。一个数据元素可由若干数据项组成，数据项是构成数据元素的不可分割的最小单位。例如，学生记录就是一个数据元素，它由学号、姓名、性别等数据项组成。\n## 数据对象\n数据对象是具有相同性质的数据元素的集合，是数据的一个子集。例如，整数数据对象是集合N={0,±1,±2,…}。\n## 数据类型\n数据类型是一个值的集合和定义在此集合上的一组操作的总称。\n1)原子类型。其值不可再分的数据类型。\n2)结构类型。其值可以再分解为若干成分(分量)的数据类型\n3)抽象数据类型(ADT)。一个数学模型及定义在该数学模型上的一组操作。它通常是对数据的某种抽象，定义了数据的取值范围及其结构形式，以及对数据操作的集合。\n## 数据结构\n数据结构是相互之间存在一种或多种特定关系的数据元素的集合。在任何问题中，数据元素都不是孤立存在的，它们之间存在某种关系，这种数据元素相互之间的关系称为结构(Structure)。数据结构包括三方面的内容：逻辑结构、存储结构和数据的运算。\n数据的逻辑结构和存储结构是密不可分的两个方面，一个算法的设计取决于所选定的逻辑结构，而算法的实现依赖于所采用的存储结构。\n# 数据结构\n## 数据的逻辑结构\n逻辑结构是指数据元素之间的逻辑关系，即从逻辑关系上描述数据。它与数据的存储无关，是独立于计算机的。数据的逻辑结构分为线性结构和非线性结构，线性表是典型的线性结构；集合、树和图是典型的非线性结构。数据的逻辑结构分类为：\n1. 线性结构\n1.1 一般线性表\n1.2 受限线性表(栈、队列、串)\n1.3 线性表推广(数组)\n2. 非线性结构\n2.1 集合\n2.2 树形结构（一般树、二叉树）\n2.3 图状结构(无向图、有向图)\n\n1)集合。结构中的数据元素之间除“同属一个集合”外，别无其他关系\n2)线性结构。结构中的数据元素之间存在一对一的关系。\n3)树形结构。结构中的数据元素之间存在一对多的关系。\n4)图状结构或网状结构。结构中的数据元素之间存在多对多的关系\n## 数据的存储结构\n存储结构是指数据结构再计算机中的表示，也称物理结构。**它包括数据元素的表示和关系的表示。** 数据的存储结构使用计算机语言你实现的逻辑结构，它依赖于计算机语言。**数据的存储结构主要有顺序存储、链式存储、索引存储和散列存储**\n1)顺序存储。把逻辑上相邻的元素存储再物理位置也相邻的存储单元中，元素之间的关系由存储单元的邻接关系来体现。其优点是可以实现随机存取，每个元素占用最少的存储空间；缺点是只能使用相邻的一整块存储单元，因此可能产生较多的外部碎片。\n2)链式存储。不要求逻辑上相邻的元素再物理位置上也相邻，借助知识元素存储地址的指针来表示元素之间的逻辑关系。其优点是不会出现碎片现象，能充分利用所有存储单元；缺点是每个元素因存储指针而占用额外的存储空间，且只能实现顺序存取。\n3)索引存储。在存储元素信息的同时还建立附加的索引表。索引表中的每项称为索引项索引项的一般形式是(关键字，地址)。其有点是检索速度快；缺点是附加的索引表额外占用存储空间。另外，增加和删除数据元素是也要修改索引表，因而会花费较多的时间。\n4)散列存储。根据元素的关键字直接计算出该元素的存储地址，也称哈希存储。其有点是检索、增加和删除节点的操作都很快；缺点是若散列函数不好，则可能出现元素存储单元的冲突，而解决冲突会增加时间和空间开销。\n# 数据的运算\n施加在数据上的运算包括运算的定义和实现。运算的定义是针对逻辑结构的，指出运算的功能；运算的实现是针对存储结构的，指出运算的具体操作步骤\n','',0),(15,'算法和算法评价','## 算法的基本概念\n算法是对特定问题求解步骤的一种描述和，他是指令的有限序列，其中的每条指令表示一个或多个操作。此外，一个算法还具有下列的五个重要特性：\n1)有穷性。一个算法必须总在执行有穷步之后结束，且每一步都可在有穷时间内完成。\n2)确定性。算法中每条指令必须由确切的含义，对于相同的输入只能得出相同的输出\n3)可行性。算法中描述的操作都可以通过已经实现的基本元素按执行有限次来实现。\n4)输入。算法有0个或多个输入，这些输入取自于某个特定的对象的集合。\n5)输出。一个算法有一个或多个输出，这些输出是于输入有着某种特定关系的量。\n通常，设计一个“好”的算法应考虑达到以下目标：\n1)正确性。算法应能够正确地解决求解问题。\n2)可读性。算法应具有良好的可读性，以帮助人们理解。\n3)健壮性。算法能对输入的非法数据作出反应或处理，而不会产生莫名其妙的输出。\n4)高效率与低存储量需求。效率是之算法执行的时间，存储量需求是指算法执行过程中所需要的最大存储空间，这两者都与问题规模有关\n## 算法效率的度量\n算法效率的度量是通过时间复杂度和空间复杂度来描述的。\n### 时间复杂度\n一个语句的频度是指该语句在算法中被重复执行的次数。算法中所有语句的频度之和基于T(n)，他是该算法问题规模n的函数，时间复杂度主要分析T(n)的数量级。算法中基本运算(最深层循环中的语句)的频度与T(n)同数量级，因此通常将算法中基本运算的执行次数的数量级作为该算法的时间复杂度。于是，算法的时间复杂度记为$$T(n)=O(f(n))$$式中，O的含义是T(n)的数量级，其严格的数学定义是：若T(n)和f(n)是定义在正整数集合上的两个函数，则存在正常数C和$n_0$使得当n大于$n_0$时都满足$0\\le T(n)\\le Cf(n)$。\n算法的时间复杂度不仅依赖于问题的规模n，也取决于待输入数据的性质(如输入数据元素的初始状态)。例如，在数组A[0......n-1]中，查找给定值k的算法大致如下：\n```c\n(1)i = n-1;\n(2)while(i>=0&&(A[i]!=k))\n(3)    i--;\n(4)return i;\n```\n该算法中语句3的频度不仅与问题规模n有关，而且与下列因素有关：\n1. 若A中没有与k相等的元素，则语句3的频度f(n)=n。\n2. 若A的最后一个元素等于K,则语句3的频度f(n)是常数0\n\n**最坏时间复杂度是指在对坏的情况下，算法的时间复杂度。**\n**平均时间复杂度是指所有可能输入实例在等概率出现的情况下，算法的期望运行时间**\n**最好时间复杂度是指在最好情况下，算法的时间复杂度。**\n一般总是考虑<u>在最坏情况下的时间复杂度</u>以保证算法的运行时间不会比它更长。\n在分析一个程序的时间复杂性时，有以下两条规则：\n1) 加法规则：\n$$T(n)=T_1(n)+T_2(n)=O(f(n))+O(g(n))=O(max(f(n),g(n)))$$\n2)乘法规则：$$T(n)=T_1(n)*T_2(n)=O(f(n))*O(g(n))=O(f(n)*g(n))$$\n常见的渐进时间复杂度为\n$$O(1)<O(log_2n)<O(n)<O(nlog_2n)<O(n^2)<O(n^3)<O(2^n)<O(n!)<O(n^n)$$\n### 空间复杂度\n算法的空间复杂度S(n)定义为该算法所需的存储空间，它是问题规模n的函数，记为S(n)=O(g(n))\n一个程序在执行时除需要存储空间来存放本身所用的指令、常熟、变量和输入数据外，还需要对一些数据进行操作的工作单元和存储一些为实现计算所需信息的辅助空间。若输入数据所占空间只取决于问题本身，和算法无关，则只需分析除<u>除输入和程序之外的额外空间</u>。例如，若算法中新建了几个与输入数据规模n相同的辅助数组，则空间复杂度为O(n)。\n算法原地工作是指算法所需的辅助空间为常量，即O(1)。\n','',0),(16,'','','',0),(17,'线性表的定义和基本操作','## 线性表的定义\n线性表是具有相同数据类型的n(n$\\geq$0)个数据元素的有限序列，其中n为表长，当n=0时线性表是一个空表。若用L命名线性表，则其一般表示为$$L=(a_1.a_2,……,a_i,a_{i+1},……,a_n)$$式中$a_1$是唯一的“第一个”数据元素，也称表头元素；$a_n$是唯一的“最后一个”数据元素，也称表尾元素。除第一个元素外，每个元素有且只有一个直接前驱。除最后一个元素外，每个元素有且只有一个直接后继。以上就是线性表的逻辑特性，这种线性有序的逻辑结构正是线性表名字的由来。\n由此我们得出线性表的特点如下：\n<li>表中元素的个数有限</li>\n<li>表中元素具有逻辑上的顺序性，表中元素有其先后次序</li>\n<li>表中元素都是数据元素，每个元素都是单个元素</li>\n<li>表中元素的数据类型都相同，这意味着每个元素占有相同大小的存储空间</li>\n<li>表中元素具有抽象性，即进讨论元素间的逻辑关系，而不考虑元素究竟表示什么内容</li>\n\n\n**线性表是一种逻辑结构，表示元素之间一对一的相邻关系，顺序表和链表是指存储结构，两者属于不同层面的概念，因此不要将其混淆**\n\n## 线性表的基本操作\n一个数据结构的基本操作是指其最核心、最基本的操作。其他较复杂的操作可通过调用其基本操作来实现。线性表的主要操作如下。\n<li>InitList(*L)：初始化表。构造一个空的线性表</li>\n<li>Length(L)：求表长。返回线性表L的长度，即L中的数据元素的个数</li>\n<li>LocateElem(L,e)：按值查找操作。在表L中查找具有给定关键字值的元素</li>\n<li>GetElem(L,i)：按位查找操作。获取表中第i个位置的元素的值</li>\n<li>ListInsert(*L,i,e)：插入操作。在表L中的第i个位置上插入指定元素e。</li>\n<li>ListDelete(*L,i,*e)：删除操作。删除表L中的第i个位置上的元素，并用e返回删除的元素</li>\n<li>PrintList(L)：输出操作。按前后顺序输出线性表L的所有元素值。</li>\n<li>Empty(L)：判空操作。若L为空表，则返回true，否则返回false。</li>\n<li>DestroyList(*L)：销毁操作。销毁线性表，并释放线性表L所占用的内存空间。</li>\n','',0),(18,'线性表的顺序表示','## 顺序表的定义\n线性表的顺序存储也称顺序表。他是用一组地址连续的存储单元依次存储线性表中的数据元素，从而使得逻辑上相邻的两个元素在物理位置上也相邻。第一个元素存储在顺序表的起始位置，第i个元素的存储位置后面紧接着存储的是第i+1个元素，称i为元素$a_i$在顺序表中的位序。因此顺序表的特点是表中元素的逻辑顺序与其存储的物理顺序相同。\n假设顺序表L存储的起始位置为LOC(A),sizeof(ElemType)是每个数据元素所占用存储空间的大小。\n每个数据元素的存储位置都和顺序表的的起始位置相差一个和该数据元素的位序成正比的常数，因此顺序表中的任意一个数据元素都可以随机存取，所以线性表的顺序存储结构是一种随机存取的存储结构。通常用高级程序设计语言中的数组来描述线性表的顺序存储结构。\n**线性表中元素的位序是从1开始的，而数组中元素的下标是从0开始的**\n假定线性表的元素类型为ElemType，则静态分配的顺序表存储结构描述为\n```c\n#define MaxSize 50\ntypedef struct{\n    Elemtype data[MaxSize];//顺序表中的元素\n    int length;//顺序表的当前长度\n}Sqlist; //顺序表的类型定义\n```\n一维数组可以是静态分配的，也可以是动态分配的。对数组进行静态分配时，因为数组的大小和空间事先已经固定，所以一旦空间占满，再加入新数据就会产生溢出，进而导致程序崩溃。\n而在动态分配时，存储数组的空间时在程序执行过程中动态分配语句分配的，一旦数据空间沾满，就开辟一块更大的存储空间，将原表中的数据元素全部拷贝到新空间，从而达到扩充数组存储空间的目的，而不需要为线性表一次性地划分所有空间。\n动态分配的顺序表存储结构描述为\n```c\n#define InitSize 100 //表长度的初始定义\ntypedef struct{\n    ElemType *data;\n    int MaxSize,length;//数组的最大容量和当前个数\n}SeqList;\n```\n**动态分配并不是链式存储，它同样属于顺序存储结构，物理结构没有变化，依然是随机存取方式，知识分配的空间大小可以在运行时动态决定**\n顺序表 的主要优点：\n1. 可以进行随机访问，即可通过首地址和元素序号可以在O(1)时间内找到指定的元素。\n2. 存储密度高，每个节点只存储数据元素。\n\n顺序表的缺点也明显：\n1. 元素的插入和删除后需要移动大量的元素，插入操作平均需要移动$frac{n}{2}$个元素，删除操作平均需要移动$frac{n-1}{2}$个元素\n2. 顺序存储分配需要一段连续的存储空间，不够灵活。\n## 顺序表上基本操作的实现\n### 顺序表的初始化\n静态分配和动态分配的顺序表的初始化操作时不同的。静态分配在声明一个顺序表时，就已为其分配了数组空间，因此初始化只需将顺序表的当前长度设为0。\n```c\nvoid InitList(SqList *L){\n    L->length=0;\n}\n```\n动态分配的初始化为顺序表分配一个预定义大小的数组空间，并将顺序表的当前长度设为0。MaxSize指示顺序表当前分配的存储空间大小，一旦因插入元素而空间不足，就进行再分配\n```c\nvoid InitList(SeqList *L){\n    L->data=(Elemtype *)malloc(InitSize*sizeof(Elemtype));//分配存储空间\n    L->length=0;\n    L.MaxSize=InitSize;\n}\n```\n### 插入操作\n在顺序表的第i个位置插入新元素e。若i的输入不合法，则返回false，表示插入失败；否则，将第i个元素及其后的所有元素一i此往后移动一个位置，腾出一个空位置插入新元素e,顺序表长度增加1，插入成功，返回true\n```c\nbool ListInsert(SqList *L,int i,Elemtype){\n    if(i<1||i>L->length+1){\n        return false\n    }\n    if(L->length>=MaxSize){\n        return false;\n    }\n    for(int j=L->length;j>=i;j--){\n        L->data[j]=L->data[j-1]\n    }\n    L->data[i-1]=e;\n    L->length++;\n    return true;\n}\n```\n最好情况：在标为插入(i=n+1),元素后移语句将不执行,时间复杂度为O(1);\n最坏情况下，在第一个位置进行插入元素，所有的元素都要后移，元素后移语句执行n次，时间复杂度为O(n)\n平均情况，\n第1个位置移动n个元素，......第n+1个位置，移动0个元素\n$0+......+n = \\frac{(n+0)(n+1)}{2}$\n又因为每一个位置等可能出现，所以还要乘上一个$\\frac{1}{n+1}$因此得到平均移动次数$\\frac{1}{n}$\n因此顺序表的插入算法的平均时间复杂度为O(n)。\n### 删除操作\n删除顺序表L中第i(1<=i<=L->length)个位置的元素，用引用变量e返回。若i的输入不合法，则返回false，否则，将删除元素赋给引用变量e，并将第i+1个元素及其后面的所有元素依次向前移动一个位置，返回true\n```c\nbool ListDelete(SqList *L,int i,Elemtype *e){\n    if(i<1||i>L->length){\n        return false\n    }\n    e=L->data[i-1];\n    for(int j=i;j<L->length;j++){\n        L->data[j-1]=L->data[j];\n    }\n    L->length--;\n    return true;\n}\n```\n最好的情况，删除最后一个元素，不用移动元素，时间复杂度为O(1)。\n最坏情况：删除表头元素，需要移动n-1个元素，时间复杂度O（n）\n平均情况下，删除第一个移动n-1,.....删除最后一个，移动0个，由此\n$n-1+......+0=\\frac{(n-1+0)(n)}{2}$\n每个位置等可能，还需要乘上$\\frac{1}{n}$因此平均移动$\\frac{n-1}{2}$次。时间复杂度为O(n).\n### 按值查找(顺序查找)\n```c\nint LocateElem(SqList L,Elemtype e){\n    int i;\n    for(i=0;i<L->length;i++){\n        if(L->data[i]==e){\n            return i+1;\n        }\n    }\n    return 0;\n}\n```\n直接分析平均情况\n|位置|1|2|...|n|\n|比较次数|1|2|...|n|\n因此比较次数为$1+2+......+n = \\frac{n(n+1)}{2}$\nn个位置出现的概率相等，因此除去n得到$\\frac{n+1}{2}$次比较次数，时间复杂度为O(n)。\n\n','',0),(19,'','','',0),(20,'文法和语言','# 文法和语言\n一个程序程序设计语言是一个记号系统，如同自然语言一样，它的完整定义应包括语法和语义两个方面。所谓一个语言的语法是指一组规则，用它可以形成和产生一个合适的程序。目前广泛使用的手段是上下文无关文法，即用上下文无关文法作为程序设计语言语法的描述工具。语法只是定义什么样的符号序列是合法的，与这些符号的含义毫无关系，比如对于一个Pascal程序来说，一个上修改问无关文法可以定义符号串A:=B+C是一个合乎语法的赋值语句，而A:=B+就不是。但是如果B是实型的而C是布尔型的，或者B、C中任何一个变量没有实现说明，则A:=B+C仍不是正确的程序，也就是说程序结构上的这种特点——类型匹配、变量作用域等是无法用上下文无关手段检查的，这些工作属于语义分析工作。**程序设计语言的语义常常分为两类：静态语义和动态语义**\n静态语义是一系列限定规则，并确定哪些合乎语法的程序是合适的；动态语义也称作运行语义或执行语义，表明程序要做些什么，要计算什么。\n阐明语法的的一个工具是文法，这是形式语言理论的基本概念之一。本章将介绍文法和语言的概念，重点讨论上下文无关文法及其局型分析中的有关问题。\n阐明语义要比阐明语法困难的多，尽管形式语义学的研究已取得重大进展，但是人没有哪一种公认的形式系统可用来自动构造出正确的编译系统。本书不对形式语义学进行介绍。\n## 文法的直观概念\n当我们表述一种语言的时候，无非是说明这种语言的句子，如果语言只含有有穷多个句子，则只需列出句子的有穷集就行了，但对于含有无穷多个句子的语言来讲，存在着如何给出它的有穷表示的问题。\n<li>有穷语言给出有穷集表示即可，无穷语言要怎么给出有穷表示？</li>\n以自然语言为例，人们无法列出全部句子，但是人们可以给出一些规则，用这些规则来说明句子的组成结构，如“我是大学生”是汉语的一个句子。汉语句子可以由主语后随谓语而成，构成谓语的是动词和直接宾语，次啊用第一章使用过的EBNF来表示这种句子的构成规则：\n\n<句子>::=<主语><谓语>\n<主语>::=<代词>|<名词>\n<代词>::=我|你|他\n<名词>::=王明|大学生|工人|英语\n<谓语>::=<动词><直接宾语>\n<动词>::=是|学习\n<直接宾语>::=<代词>|<名词>\n\"我是大学生\"的构成符合上述规则，而\"我大学生是\"不符合上述规则，即它不是句子。这些规则称为判别句子结构合法与否的依据，换句话说和，将这些规则看成是一种元语言，用它描述汉语。这里仅仅涉及汉语句子的结构描述。这样的语言描述称为文法。\n一旦有了一组规则以后，可以按照如下的方式用他们去推导或产生句子。开始去找::=左端带有<句子>的规则并把它表示成::=右端的符号串，这个动作表示成:<句子>$\\Rightarrow$<主语><谓语>然后在得到的串中选取<主语>或<谓语>再用相应的规则::=右端代替，依次重复下去，得到句子“我是大学生”的全部动作过程如下:\n$$\\begin{aligned}<句子>& \\Rightarrow <主语><谓语> \\\\\n&\\Rightarrow<代词><谓语> \\\\\n&\\Rightarrow我<谓语> \\\\\n&\\Rightarrow我<动词><直接宾语> \\\\\n&\\Rightarrow我是<直接宾语> \\\\\n&\\Rightarrow我是<名词> \\\\\n&\\Rightarrow我是大学生\n\\end{aligned}$$\n符号$\\Rightarrow$的含义是，使用一条规则，代替其左端的某个符号，产生其右端的符号串。\n可以看出使用文法作为工具，不仅是为了严格定义句子的结构，也是为了用适当条数的规则把语言的全部句子秒偶数出来，可以说文法是以有穷的集合刻画无穷的集合的一个工具。\n<li>上面说无穷无言描述的问题就是如何用有穷集和表示出来，现在问题就解决了，用文法</li>\n\n## 符号和符号串\n正如英语是由句子组成的集合，而句子又是由单词和标点符号组成的序列那样，c语言等编程语言可以看成实在基本符号集i上定义的、按一定规则构成的一切基本符号串组成的集合。为了给出语言的形式定义，首先讨论符号和符号串的有关概念\n### 字母表\n字母表是元素的非空有穷集合，字母表中的元素称为符号，因此字母表也称为符号集。不同的语言可以有不同的字母表，例如汉语的字母表中包括和汉字、数字及标点符号等。C语言的字母表由字母、数字、若干朱涵泳符号及char、struct、if、do之类的保留字组成。\n### 符号串\n**由字母表中的符号组成的任何有穷序列称为符号串**，例如001110是字母表$\\Sigma=\\{0,1\\}$上的符号串。在符号串中，符号的顺序是很重要的。\n如果符号串x中有m个符号，则称其长度为|x|=m。\n允许空符号串，即不包含任何符号的符号串，用$\\epsilon$表示，其长度为0,$|\\epsilon|=0$。\n下面介绍以下关于符号串的一些运算\n1) 符号串的头尾，固有头和固有尾\n头：从前往后连续的串都算头\n尾：从后往前连续的串都算尾\n固有头选取后尾不为空，固有尾：选取之后头不为空\n2) 符号串的连接\nx和y的连接xy是把y的符号写在x的符号后面\n3)符号串的方幂\n把符号串自己链接n次，方幂是几就连接几次。\n4)符号串集合\n若集合A中的一切元素都是某字母表上的符号串，则称A为该字母表上的符号串集合。两个符号串A和B的乘积定义如下:$AB={xy|x\\in A且y\\in B}$即AB是满足x属于A，y属于B的所有符号串xy所组成的集合。指定字母表$\\Sigma$之后可用$\\Sigma^*$表示$\\Sigma$上的所有有穷长的串的集合。\n$$\\Sigma^*=\\Sigma^0\\cup\\Sigma^1\\cup\\Sigma^2\\cup......$$\n$\\Sigma^*$称为$\\Sigma$的闭包，\n$\\Sigma^+$表示$\\Sigma$的正闭包，里面不包含$\\Sigma^0$\n我们可以知道\n$\\Sigma^*=\\Sigma^0\\cup\\Sigma^+$\n$\\Sigma^+=\\Sigma\\Sigma^*=\\Sigma^*\\Sigma$\n## 文法和语言的形式定义\n规则，也称重写规则、产生式或生成式，是形如$\\alpha\\to\\beta$的($\\alpha,\\beta$)有序对，其中$\\alpha$称为规则的左部，$、beta$称为规则的右部。这里使用的符号$\\to$读作“定义为”。\n定义:文法G定义为四元组($V_N,V_T,P,S$)\n其中$V_N$是非终结符集，$V_T$是终结符集，P为规则集，S被称作开始符或识别符，它是一个非终结符，至少要在一条规则中作为左部出现。\n很多时候，不用将文法G的四元组显示地表示处理啊，而只将产生式写出。一般约定，第一条产生式的左部是识别符；尖括号括起来的是非终结符，不用尖括号括起来的是终结符，或者用大写字母表示非终结符，小写字母表示终结符。\n$$\\begin{align}G:&S\\to0S1 \\\\&S\\to01\\end{align}$$\n此外还需要引入推导的概念\n定义：设$\\alpha\\to\\beta$是文法G=($V_N,V_T,P,S$)的规则，$\\gamma$和$\\delta$是$V^*$中的任意符号，若有符号串v,w满足\n$v=\\gamma\\alpha\\delta$，$w=\\gamma\\beta\\delta$则说v应用规则$\\alpha\\to\\beta$直接产生w或说w是v的直接推导，或说w直接规约到v记作$v\\Rightarrow w$\n定义：如果存在直接推到的序列：\n$v=w_0\\Rightarrow w_1\\Rightarrow w_2\\Rightarrow ··· \\Rightarrow w_n = w$则称v推导出(产生)w(推导长度为n)，或称w规约到v记作$v\\Rightarrow^{+}w$\n定义：如果有$v\\Rightarrow^{+}w$或$v=w$则记作$v\\Rightarrow^* w$\n定义：设G[S]是一个文法如果符号串x是从识别符号推导出来的，即有$S\\Rightarrow^* x$,则称x是文法G[S]的句型。若x仅由终结符号组成，即$S\\Rightarrow^* x,x\\in V_T^*$则称x为G[S]的句子。\n定义：文法G所产生的语言定义为集合{x|$S\\Rightarrow^*x$,其中S为文法识别符号，且$x\\in V_T^*$}。可用L(G)表示该集合。\n文法描述的语言是该文法一切句子的集合。\n定义：若L(G1)=L(G2),则称文法G1和G2是等价的。\n## 文法的类型\n自从乔姆斯基于1956年建立形式语言的描述以来，形式语言的理论发展很快。这种理论对计算机科学有着深刻的影响，特别是对程序设计语言的设计、编译方法和计算复杂性等方面更有重大作用。\n乔姆斯基把文法分成4种类型，即0型、1型、2型、3型。这几类文法的差别在于对产生式施加不同的限制。\n设G=$(V_N,V_T,P,S)$,如果它的每一个产生式$\\alpha \\to \\beta$是这样一种结构$\\alpha \\in (V_N \\cup V_T)^*$且至少含有一个非终结符，而$\\beta \\in (V_N \\cup V_T)^*$则G是一个0型文法。\n<span style=\"color: red;\">0型文法也称为短语文法。一个非常重要的理论结果是，0型文法的能力相当于图灵机。或者说任何0型语言都是递归可枚举的；反之，递归可枚举集必定是一个0型语言。(没看懂这里是什么意思)</span>\n设$G=(V_N,V_T,P,S)$是一个文法，若P中的每一个产生式$\\alpha \\to \\beta$均满足$|\\beta|\\ge |\\alpha|$仅仅$S\\to \\epsilon$除外，则文法G是1型或上下文有关的。\n设$G=(V_N,V_T,P,S)$是一个文法，若P中的每一个产生式$\\alpha \\to \\beta$均满足$\\alpha$是一个非终结符，$\\beta \\in (V_N \\cup V_T)^*$，则文法G是2型或上下文无关的。\n设$G=(V_N,V_T,P,S)$是一个文法，若P中的每一个产生式的形式都是$A\\to aB$或$A\\to a$其中AB都是非终结符，$a \\in V_T^*$，则文法G是3型文法或正规文法。\n4种文法类型的定义是逐渐增加限制的，因此每一种正规文法都是上下文无关的，每一种上下文无关文法都是上下文有关的，而每一种上下文有关文法都是0型文法。称0型文法产生的语言为0型语言。上下文有关文法、上下文无关文法和正规文法产生的语言分别称为上下文有关语言、上下文无关语言和正规语言。\n## 上下文无关文法及其语法树\n给定文法$G=(V_N,V_T,P,S)$,对于G的任何句型都能构造与之关联的语法树。这棵树满足下列四个条件：\n1. 每个节点都有一个标记，此标记是V的一个符号\n2. 根的标记是S\n3. 若一个节点n至少有一个它自己除外的子孙，并且有标记A，则A肯定在$V_n$中。\n4. 如果节点n的直接子孙从左到右的次序是节点$n_1,n_2,···,n_k$,其标记分别为$A_1,A_2,···,A_k$那么$A\\to A_1A_2···A_k$一定是P中的一个产生式。\n\n**语法树表示了在推导过程中施用了哪个产生式和施用在哪个非终结符上，它并没有表明使用产生式的顺序**。\n如果在推导的任何一步$\\alpha \\Rightarrow \\beta$,其中$\\alpha$、$\\beta$是局型，都是对$\\alpha$中的最左(最右)非终结符进行替换，则称这种推导为最左(最右)推导。在形式语言中，最右推导被称为规范推导。由规范推导所得到的句型称为右句型或规范句型。\n如果一个文法存在某个句子对应两颗不同的语法树，则说这个文法是二义的。或者说，若一个文法存在某个句子，他有两个不同的最左(最右)推导，则这个文法是二义的。\n文法的二义性和语言的二义性是两个不同的概念，可能右两个文法，其中一个文法是二义的，另一个文法不是二义的，但是语言却一样。如果产生上下文无关语言的每一个文法都是二义的，则说此语言是先天二义的。对于一个程序设计语言来说，常常希望它的文法是无二义的，因为希望对它的每个语句的分析是唯一的。\n我们无法在有限步骤内确定任给的的一个文法是否为二义的。我们所能做的事是寻找一组充分条件。\n## 句型的分析\n对于上下文无关文法，语法树是句型推导过程的几何表示，语法树是句型分析（如何知道给定的符号串是文法的句型）的极好工具。句型的分析就是识别一个符号串是否为某文法的句型，是某个推导的构造过程。也就是说当给定一个符号串的时候，按照某文法的规则给出该符号的推导或者语法树，来识别这是文法的一个句型；当符号串全部由终结符号组成时，就是识别它是不是某文法的句子。因此也有人把语法树称为语法分析树或分析书。在语言的编译视线中，把完成句型分析的程序称为分析程序或识别程序，分析算法又称识别算法。\n这种分析算法又可以分为两大类，即自上而下的和自下而上的。\n自上而下分析：从文法的开始符号出发，反复使用各种产生式，寻找匹配于输入符号串的推导。\n自下而上分析：从输入符号串开始，逐步进行规约，直至归约到文法的开始符号。\n**从语法树建立的方式可以很好理解这两类方法的区别。自上而下方法是从文法符号开始，将它作为语法树的根，向下逐步建立语法树，使语法树的末端结点符号串正好是输入符号串；自下而上方法则是从输入符号串开始，以它作为语法树的末端结点符号串，自下而上地构造语法树。**\n如果自上而下分析有一步可以选择多个进行替换，此时选错就需要进行回溯，回溯代价高，之后会将如何解决回溯问题。\n自下而上方法中问题时每一步如何确定可规约串。因此需要精确定义“可规约串”，存在着多种不同的方法刻画可规约串，对这个概念的不同定义形成了不同的自上而下的分析方法。在一种“规范规约”的分析中，这种可规约串称作“句柄”。\n句柄的定义：令G时一个文法，S是文法的开始符号，$\\alpha\\beta\\delta$是文法的一个句型。如果$S\\Rightarrow \\alpha A \\beta$且$A\\Rightarrow^+ \\beta$,则称$\\beta$是句型$\\alpha\\beta\\delta$相对于非终结符的短语，如果有$A\\Rightarrow \\beta$则称$\\beta$是句型$\\alpha\\beta\\delta$相对于规则$A\\Rightarrow \\beta$的直接短语。一个右句型的直接短语称为该句型的句柄。句柄的概念只适合于右句型。\n如果所考虑的文法是无二义的，那么每个右句型有唯一的最右推导，因而其句柄是唯一的。对于无二义文法，一个右句型的唯一句柄是其所有直接短语中最左边的那一个，该举行的最左直接短语是它的句柄。\n## 有关文法实际应用的一些说明\n在实际使用中，应限制文法中不得含有有害规则和多余规则。有害规则是指形如$U\\to U$的产生式，它只会引起文法的二义性。多余规则是指那些连一个句子推导都用不到的规则，这类规则在文法中以两种形式出现。一种是文法中某些非终结符不在任何规则的右部出现，所以任何句子的推导中都不可能用到它。这种非终结符也称为不可到达的。另一种情况则是在文法中有这样的非终结符：不能够从它推导出终结符号串来。这种非终结符也称为不可终止的。\n\n\n','-   **句柄一定由终结符组成吗？**\n    \n    -   不一定！句柄可以是终结符、非终结符或混合形式，取决于产生式右部。\n    -   例如，若产生式为 ( A \\\\to BC )，则句柄可能是非终结符组合 ( BC )。\n-   **如何避免混淆短语和句柄？**\n    \n    -   **短语**：通过任意步推导得到的子串。\n    -   **直接短语**：通过单步推导得到的子串（即某个产生式的右部）。\n    -   **句柄**：最左的直接短语。',0),(21,'','','',0),(22,'消除左递归、消除回溯','## 消除左递归\n形为$A\\to A\\alpha | \\beta$\n改为\n$A\\to \\beta A\'$\n$A\'\\to \\alpha A\'|\\epsilon$\n## 消除回溯\n形为$A\\to \\Delta\\beta_1 |\\Delta\\beta_2|\\Delta\\beta_3|....|\\beta_j |...|\\beta_n$\n提取左公共因子\n改为$A\\to \\Delta A\'|\\beta_j |...|\\beta_n$\n$A\'\\to \\beta_1 |\\beta_2|\\beta_3|....$','',0);
