INSERT INTO `questions` VALUES (6,'{\"stem\": \"解释下列术语：编译程序，源程序，目标程序，编译程序的前端、后端和遍\", \"type\": \"fill_blank\", \"blanks\": [{\"answer\": \"将**源程序**（用高级语言编写）转换为**目标程序**（机器语言或中间代码）的系统程序。\"}, {\"answer\": \"程序员用高级语言（如 C、Python）编写的原始代码。\"}, {\"answer\": \"编译后生成的机器相关代码（如汇编代码 `.s` 或目标文件 `.obj`）。\"}, {\"answer\": \"处理与**源语言**相关的编译阶段。\"}, {\"answer\": \"处理与**目标机器**相关的编译阶段。\"}, {\"answer\": \"编译器对源程序的一次完整遍历，可能包含多个阶段。\"}], \"explanation\": \"\"}',0,0,'#### 1\\. **编译程序（Compiler）**\n\n-   **定义**：将**源程序**（用高级语言编写）转换为**目标程序**（机器语言或中间代码）的系统程序。\n-   **功能**：\n    -   **词法分析**：将源代码分解为词法单元（如标识符、关键字）。\n    -   **语法分析**：构建抽象语法树（AST），检查语法结构。\n    -   **语义分析**：验证类型、作用域等语义规则。\n    -   **中间代码生成**：生成与机器无关的中间表示（如三地址码）。\n    -   **优化**：对中间代码进行性能或资源优化。\n    -   **目标代码生成**：生成目标机器代码（如汇编或二进制指令）。\n-   **示例**：GCC、Clang、Java 编译器（Javac）。\n\n#### 2\\. **源程序（Source Program）**\n\n-   **定义**：程序员用高级语言（如 C、Python）编写的原始代码。\n-   **特点**：\n    -   人类可读，依赖语法规则。\n    -   文件扩展名如 `.c`、`.java`。\n-   **示例**：\n    \n    ```c\n    #include <stdio.h>\n    int main() {\n        printf(\"Hello, World!\");\n        return 0;\n    }\n    ```\n    \n\n#### 3\\. **目标程序（Object Program）**\n\n-   **定义**：编译后生成的机器相关代码（如汇编代码 `.s` 或目标文件 `.obj`）。\n-   **特点**：\n    -   可能需链接（Link）其他目标文件或库生成可执行文件。\n    -   非最终可执行状态。\n-   **示例**：`main.o`（由 `main.c` 编译生成）。\n\n#### 4\\. **编译程序的前端（Frontend）**\n\n-   **定义**：处理与**源语言**相关的编译阶段。\n-   **任务**：\n    -   **词法分析**：生成 Token 流。\n    -   **语法分析**：构建 AST。\n    -   **语义分析**：类型检查、符号表管理。\n    -   生成**中间代码**（如 LLVM IR）。\n-   **特点**：与目标机器无关，可复用（如 Clang 前端支持多种后端）。\n\n#### 5\\. **编译程序的后端（Backend）**\n\n-   **定义**：处理与**目标机器**相关的编译阶段。\n-   **任务**：\n    -   **代码优化**：机器相关的优化（如寄存器分配）。\n    -   **目标代码生成**：生成汇编或二进制代码。\n-   **特点**：依赖目标架构（如 x86、ARM）。\n\n#### 6\\. **遍（Pass）**\n\n-   **定义**：编译器对源程序的一次完整遍历，可能包含多个阶段。\n-   **分类**：\n    -   **单遍编译器**：一次性完成所有步骤（如早期 Pascal 编译器）。\n    -   **多遍编译器**：分多次处理（如现代编译器优化）。\n-   **目的**：\n    -   减少内存占用（如分阶段处理大型代码）。\n    -   支持复杂优化（如循环展开需多遍分析）。'),(9,'{\"stem\": \"编译程序有哪些主要构成成分？各自的主要功能是什么？\", \"type\": \"fill_blank\", \"blanks\": [{\"answer\": \"\"}], \"explanation\": \"\"}',0,0,'**完整答案示例：** 编译程序的主要构成成分及功能如下：\n\n1.  **词法分析器（Lexical Analyzer）**  \n    将字符流转换为词素（Token）序列，识别标识符、关键字、常量等\n    \n2.  **语法分析器（Syntax Analyzer）**  \n    根据文法规则构建语法树（Parse Tree），验证程序结构合法性\n    \n3.  **语义分析器（Semantic Analyzer）**  \n    进行类型检查、作用域分析、控制流验证等语义约束检查\n    \n4.  **中间代码生成器（Intermediate Code Generator）**  \n    生成三地址码、四元式等与机器无关的中间表示（IR）\n    \n5.  **代码优化器（Code Optimizer）**  \n    对中间代码进行机器无关优化（如常量折叠、循环优化等）\n    \n6.  **目标代码生成器（Code Generator）**  \n    将优化后的中间代码转换为目标机器代码（汇编/机器指令）'),(10,'{\"stem\": \"对下列错误信息，请指出可能是编译的哪个阶段(词法分析、语法分析、语义分析、代 码生成)报告的。(1)else没有匹配的 if。(2)数组下标越界。(3)使用的函数没有定义。(4)在数中出现非数字字符。\", \"type\": \"fill_blank\", \"blanks\": [{\"answer\": \" \"}, {\"answer\": \" \"}, {\"answer\": \" \"}, {\"answer\": \" \"}], \"explanation\": \"\"}',1,0,''),(15,'{\"stem\": \"123131221\", \"type\": \"fill_blank\", \"blanks\": [{\"answer\": \"11\"}], \"explanation\": \"\"}',7,2,''),(16,'{\"stem\": \"\", \"type\": \"single_choice\", \"answer\": \"A\", \"options\": [{\"key\": \"A\", \"value\": \"2\"}, {\"key\": \"B\", \"value\": \"3\"}, {\"key\": \"C\", \"value\": \"4\"}, {\"key\": \"D\", \"value\": \"1\"}], \"explanation\": \"\"}',5,2,''),(17,'{\"stem\": \"\", \"type\": \"single_choice\", \"answer\": \"\", \"options\": [{\"key\": \"\", \"value\": \"\"}, {\"key\": \"\", \"value\": \"\"}, {\"key\": \"\", \"value\": \"\"}, {\"key\": \"\", \"value\": \"\"}], \"explanation\": \"\"}',0,0,''),(18,'{\"stem\": \"若a为终结符，则A→α·aβ为（  ）项目\", \"type\": \"single_choice\", \"answer\": \"A\", \"options\": [{\"key\": \"A\", \"value\": \"移进\"}, {\"key\": \"B\", \"value\": \"待规约\"}, {\"key\": \"C\", \"value\": \"规约\"}, {\"key\": \"D\", \"value\": \"接受\"}], \"explanation\": \"\"}',1,1,''),(19,'{\"stem\": \"LR（k）方法是（  ）\", \"type\": \"single_choice\", \"answer\": \"\", \"options\": [{\"key\": \"A\", \"value\": \"从左到右分析，是否归约句柄要向后看k个输入符号的一种编译方法\"}, {\"key\": \"B\", \"value\": \"从左到右分析，每次向前预测k步的一种编译方法\"}, {\"key\": \"C\", \"value\": \"从左到右分析，共经过k步的一种编译方法\"}, {\"key\": \"D\", \"value\": \"从左到右分析，每次走k步的一种编译方法\"}], \"explanation\": \"\"}',0,0,''),(20,'{\"stem\": \"若项目集Ik含有A->α·，则在状态k时，仅当面临的输入符号a∈FOLLOW(A)时，才采取“A->α·”动作的一定是（  ）\", \"type\": \"single_choice\", \"answer\": \"\", \"options\": [{\"key\": \"A\", \"value\": \"LR(0)文法\"}, {\"key\": \"B\", \"value\": \"SLR(1)文法\"}, {\"key\": \"C\", \"value\": \"LR(1)文法\"}, {\"key\": \"D\", \"value\": \"LALR文法\"}], \"explanation\": \"\"}',0,0,''),(24,'{\"stem\": \"LR（1）文法都是（  ）。\", \"type\": \"single_choice\", \"answer\": \"\", \"options\": [{\"key\": \"A\", \"value\": \"无二义性，但可能有左递归\"}, {\"key\": \"B\", \"value\": \"无二义性，且无左递归\"}, {\"key\": \"C\", \"value\": \"可能有二义性，但无左递归\"}, {\"key\": \"D\", \"value\": \"可以既有二义性，又有左递归\"}], \"explanation\": \"\"}',0,0,''),(25,'{\"stem\": \"自顶向下的语法分析方法的基本思想是：从文法的(       )开始，根据给定的输入串并按照文法的产生式一步一步的向下进行(      )，试图推导出文法的句子，使之与给定的输入串匹配。 自底向上的语法分析方法的基本思想是：从输入串入手，利用文法的产生式一步一步地向上进行(      )，力求归约到文法的(       )。\\n\\n(1 )开始符号  (2) 直接推导 (3)直接归约 (4)终结符号 （5）非终结符号\", \"type\": \"single_choice\", \"answer\": \"B\", \"options\": [{\"key\": \"A\", \"value\": \"(5)  (3)  (2)  (1)\"}, {\"key\": \"B\", \"value\": \"(1)  (2)  (3)  (1)\"}, {\"key\": \"C\", \"value\": \"(1)  (3)  (2)  (4)\"}, {\"key\": \"D\", \"value\": \"(1)  (2)  (3)  (5)\"}], \"explanation\": \"自顶向下方法从文法的开始符号（1）出发，通过直接推导（2）生成句子；自底向上方法从输入串通过直接归约（3）反向构造推导，最终归约到开始符号（1）。选项B正确。\"}',0,0,''),(26,'{\"stem\": \"下列项目中，表示句柄αβγ已完全出现在栈顶的是（   ）\", \"type\": \"single_choice\", \"answer\": \"\", \"options\": [{\"key\": \"A\", \"value\": \"A→α•βγ\"}, {\"key\": \"B\", \"value\": \"A→αβ•γ\"}, {\"key\": \"C\", \"value\": \"A→•αβγ\"}, {\"key\": \"D\", \"value\": \"A→αβγ•\"}], \"explanation\": \"\"}',0,0,''),(27,'{\"stem\": \"就文法描述能力来说，有（）。\", \"type\": \"single_choice\", \"answer\": \"\", \"options\": [{\"key\": \"A\", \"value\": \"LR(1) ⊂ LALR(1)\"}, {\"key\": \"B\", \"value\": \"无二义文法 ⊂ LR(1)\"}, {\"key\": \"C\", \"value\": \"SLR(1) ⊂ LR(1)\"}, {\"key\": \"D\", \"value\": \"LR(1) ⊂ LR(0)\"}], \"explanation\": \"\"}',0,0,''),(28,'{\"stem\": \"LR分析法在自左至右扫描输入串时就能发现错误，但不能准确地指出出错地点。\", \"type\": \"single_choice\", \"answer\": \"\", \"options\": [{\"key\": \"A\", \"value\": \"对\"}, {\"key\": \"B\", \"value\": \"错\"}], \"explanation\": \"\"}',0,0,''),(31,'{\"stem\": \"\", \"type\": \"single_choice\", \"answer\": \"\", \"options\": [{\"key\": \"\", \"value\": \"\"}, {\"key\": \"\", \"value\": \"\"}, {\"key\": \"\", \"value\": \"\"}, {\"key\": \"\", \"value\": \"\"}], \"explanation\": \"\"}',0,0,''),(32,'{\"stem\": \"由最右推导得到的句型称为规范句型。\", \"type\": \"single_choice\", \"answer\": \"\", \"options\": [{\"key\": \"A\", \"value\": \"对\"}, {\"key\": \"B\", \"value\": \"错\"}], \"explanation\": \"\"}',0,0,''),(33,'{\"stem\": \"一个无二义文法的句型的句柄是不唯一的。\", \"type\": \"single_choice\", \"answer\": \"\", \"options\": [{\"key\": \"A\", \"value\": \"对\"}, {\"key\": \"B\", \"value\": \"错\"}], \"explanation\": \"\"}',0,0,''),(34,'{\"stem\": \"自下而上分析方法也称为“移进-归约”法，是指从输入符号串开始，查找当前左句型进行归约，直到最后得到开始符号的一种分析方法。\", \"type\": \"single_choice\", \"answer\": \"\", \"options\": [{\"key\": \"A\", \"value\": \"对\"}, {\"key\": \"B\", \"value\": \"错\"}], \"explanation\": \"\"}',0,0,''),(35,'{\"stem\": \"采用规范归约，每步的可归约串是当前句型的句柄。\", \"type\": \"single_choice\", \"answer\": \"\", \"options\": [{\"key\": \"A\", \"value\": \"对\"}, {\"key\": \"B\", \"value\": \"错\"}], \"explanation\": \"\"}',0,0,''),(37,'{\"stem\": \"一个LR分析器包括两部分：一个总控程序、由两部分构成的一张分析表和一个符号栈。\", \"type\": \"single_choice\", \"answer\": \"\", \"options\": [{\"key\": \"A\", \"value\": \"对\"}, {\"key\": \"B\", \"value\": \"错\"}], \"explanation\": \"\"}',0,0,''),(38,'{\"stem\": \"某语言的拓广文法G\'为：$$(0)S\'\\\\to S \\\\\\\\(1)S \\\\to Db|B \\\\\\\\(2)D \\\\to d|\\\\epsilon \\\\\\\\(3)B \\\\to Ba|\\\\epsilon$$证明G不是LR(0)文法而是SLR(1)文法，请给出SLR(1)分析表\", \"type\": \"fill_blank\", \"blanks\": [{\"answer\": \"\"}], \"explanation\": \"\"}',0,0,''),(39,'{\"stem\": \"2.下面文法G为：$$(1)E\' \\\\to E \\\\\\\\\\\\ (2)E \\\\to rB \\\\\\\\\\\\ (3)B \\\\to B;d \\\\\\\\\\\\ (4)B \\\\to d$$判断G是SLR(1)还是LR(1),说明理由，并构造相应的分析表\", \"type\": \"fill_blank\", \"blanks\": [{\"answer\": \"\"}], \"explanation\": \"\"}',0,0,''),(40,'{\"stem\": \"已知文法G[M]:$$(1)M \\\\to VbA\\\\\\\\(2)V\\\\to d\\\\\\\\(3)V \\\\to \\\\epsilon\\\\\\\\(4)A\\\\to a\\\\\\\\(5)A \\\\to Aba\\\\\\\\(6)A\\\\to \\\\epsilon$$\\n\\n| 状态 | b   | d   | a   | #   | M   | A   | V   |\\n|------|-----|-----|-----|-----|-----|-----|-----|\\n| 0    | r3  | S3  |     |     | 1   |     | 2   |\\n| 1    |     |     |     | acc |     |     |     |\\n| 2    | S4  |     |     |     |     |     |     |\\n| 3    | r2  |     |     |     |     |     |     |\\n| 4    | r6  |     | S5  | r6  |     |  6  |     |\\n| 5    | r4  |     |     | r4  |     |     |     |\\n| 6    | S7  |     |     | r1  |     |     |     |\\n| 7    |     |     | S8  |     |     |     |     |\\n| 8    | r5  |     |     | r5  |     |     |     |\\n请给出串dbba#的分析过程。\", \"type\": \"fill_blank\", \"blanks\": [{\"answer\": \"\"}], \"explanation\": \"\"}',0,0,'### 分析过程\n\n| 步骤 | 状态栈       | 符号栈 | 剩余输入 | 动作                       |\n|------|--------------|--------|----------|----------------------------|\n| 1    | 0            |        | dbba#    | 移进 d 到 S3              |\n| 2    | 0, 3         | d      | bba#     | 归约 r2 (V → d)           |\n| 3    | 0, 2         | V      | bba#     | 移进 b 到 S4              |\n| 4    | 0, 2, 4      | Vb     | ba#      | 归约 r6 (A → ε)           |\n| 5    | 0, 2, 4, 6   | VbA    | ba#      | 移进 b 到 S7              |\n| 6    | 0, 2, 4, 6,7 | VbAb   | a#       | 移进 a 到 S8              |\n| 7    | 0, 2, 4, 6,7,8 | VbAba | #        | 归约 r5 (A → Aba)         |\n| 8    | 0, 2, 4, 6   | VbA    | #        | 归约 r1 (M → VbA)         |\n| 9    | 0, 1         | M      | #        | 接受 (acc)               |\n\n---\n\n### 关键步骤解析\n\n1. **步骤1-2**  \n   初始状态 `0` 遇到 `d`，移进到状态 `3`。随后状态 `3` 遇到 `b`，根据 `r2` 归约 `V → d`，符号栈变为 `V`，状态转移到 `2`。\n\n2. **步骤3**  \n   状态 `2` 遇到 `b`，移进到状态 `4`  \n   （假设用户表格中状态 `2` 的 `b` 列应为 `S4`，可能原表排版有误）。\n\n3. **步骤4**  \n   状态 `4` 遇到 `b`，归约 `A → ε`（`r6`），因 `b` 属于 `FOLLOW(A)`（推导见下文）。归约后符号栈压入 `A`，状态转移到 `6`。\n\n4. **步骤5-7**  \n   状态 `6` 遇到 `b`，移进到状态 `7`，随后遇到 `a` 移进到状态 `8`。紧接着归约 `A → Aba`（`r5`），符号栈更新为 `A`。\n\n5. **步骤8-9**  \n   归约 `M → VbA`（`r1`），最终状态 `1` 接受输入。\n\n---\n\n### 文法 FOLLOW 集验证\n\n- **FOLLOW(A)**：  \n  由 `M → VbA` 得，`A` 后接结束符 `#`；  \n  由 `A → Aba` 得，`A` 后接 `b`。  \n  ∴ **FOLLOW(A) = {b, #}**  \n  因此在状态 `4` 遇到 `b` 时允许归约 `A → ε`（`r6`）。\n\n- **FOLLOW(V)**：  \n  由 `M → VbA` 得，`V` 后接 `b`。  \n  ∴ **FOLLOW(V) = {b}**  \n  因此在状态 `0` 遇到 `b` 时归约 `V → ε`（`r3`）。\n\n---\n\n### 答案总结\n\n分析过程成功完成，最终接受输入串 `dbba#`。'),(41,'{\"stem\": \"CPU中用来存储操作数的存储单元主要有堆栈、累加器和（       ）。\", \"type\": \"fill_blank\", \"blanks\": [{\"answer\": \"通用寄存器组\"}], \"explanation\": \"\"}',0,1,''),(42,'{\"stem\": \"不需要编址的数据存储空间是（    ）。\", \"type\": \"single_choice\", \"answer\": \"D\", \"options\": [{\"key\": \"A\", \"value\": \"CPU中的通用寄存器\"}, {\"key\": \"B\", \"value\": \"主存储器\"}, {\"key\": \"C\", \"value\": \" I/O接口中的寄存器\"}, {\"key\": \"D\", \"value\": \"堆栈\"}], \"explanation\": \"\"}',0,1,''),(43,'{\"stem\": \"\", \"type\": \"single_choice\", \"answer\": \"\", \"options\": [{\"key\": \"\", \"value\": \"\"}, {\"key\": \"\", \"value\": \"\"}, {\"key\": \"\", \"value\": \"\"}, {\"key\": \"\", \"value\": \"\"}], \"explanation\": \"\"}',0,0,''),(44,'{\"stem\": \"操作码优化的主要目的是（    ）。\", \"type\": \"single_choice\", \"answer\": \"D\", \"options\": [{\"key\": \"A\", \"value\": \"缩短指令字长\"}, {\"key\": \"B\", \"value\": \"减少程序总位数\"}, {\"key\": \"C\", \"value\": \" 增加指令字表示的信息\"}, {\"key\": \"D\", \"value\": \"A、B和C\"}], \"explanation\": \"\"}',0,0,''),(45,'{\"stem\": \"RISC执行程序的速度比CISC要快的原因是（    ）。\", \"type\": \"single_choice\", \"answer\": \"C\", \"options\": [{\"key\": \"A\", \"value\": \"RISC的指令系统中指令条数较少\"}, {\"key\": \"B\", \"value\": \"程序在RISC上编译生成的目标程序较短\"}, {\"key\": \"C\", \"value\": \"RISC的指令平均执行周期数较少\"}, {\"key\": \"D\", \"value\": \"RISC只允许load和store指令访存\"}], \"explanation\": \"\"}',0,0,''),(46,'{\"stem\": \"面向目标程序优化的思想是（    ）。\", \"type\": \"single_choice\", \"answer\": \"C\", \"options\": [{\"key\": \"A\", \"value\": \"通过使用频度分析和改进指令系统\"}, {\"key\": \"B\", \"value\": \"增设强功能复合指令代替原来的软件实现\"}, {\"key\": \"C\", \"value\": \"A和B\"}, {\"key\": \"D\", \"value\": \"面向编译系统改进指令系统\"}], \"explanation\": \"\"}',0,1,''),(47,'{\"stem\": \"可以用()定义一个完整的数据结构\", \"type\": \"single_choice\", \"answer\": \"D\", \"options\": [{\"key\": \"A\", \"value\": \"数据元素\"}, {\"key\": \"B\", \"value\": \"数据对象\"}, {\"key\": \"C\", \"value\": \"数据关系\"}, {\"key\": \"D\", \"value\": \"抽象数据类型\"}], \"explanation\": \"\"}',0,2,''),(48,'{\"stem\": \"下列四种数据结构中，（）是非线性数据结构。\", \"type\": \"single_choice\", \"answer\": \"A\", \"options\": [{\"key\": \"A\", \"value\": \"树\"}, {\"key\": \"B\", \"value\": \"字符串\"}, {\"key\": \"C\", \"value\": \"队列\"}, {\"key\": \"D\", \"value\": \"栈\"}], \"explanation\": \"\"}',3,1,''),(49,'{\"stem\": \"下列选项中属于逻辑结构的是\", \"type\": \"single_choice\", \"answer\": \"C\", \"options\": [{\"key\": \"A\", \"value\": \"顺序表\"}, {\"key\": \"B\", \"value\": \"哈希表\"}, {\"key\": \"C\", \"value\": \"有序表\"}, {\"key\": \"D\", \"value\": \"单链表\"}], \"explanation\": \"\"}',2,2,''),(50,'{\"stem\": \"下列数据结构的说法中正确的是（）\", \"type\": \"single_choice\", \"answer\": \"A\", \"options\": [{\"key\": \"A\", \"value\": \"数据的逻辑结构独立于其存储结构\"}, {\"key\": \"B\", \"value\": \"数据的存储结构独立于其逻辑结构\"}, {\"key\": \"C\", \"value\": \"数据的逻辑结构唯一决定其存储结构\"}, {\"key\": \"D\", \"value\": \"数据结构仅由其逻辑结构和存储结构决定\"}], \"explanation\": \"\"}',0,1,'# 第一次做此题\n有个疑问，逻辑结构跟具体的实现没有关系，也就是逻辑结构独立于存储结构，但是存储结构我要怎么选也没关系吧，不同的逻辑结构可以用同样的存储结构来表示，为什么不能说数据的存储结构独立于其逻辑结构？还是说因为存储结构是为了实现逻辑结构的，所以存储结构的这种目的性使得其不独立于逻辑结构？\n## AI的解释\n您的核心观点（逻辑结构独立于存储结构）是正确的，但需注意：**存储结构的设计必须符合逻辑结构的需求**，因此它并非独立。选项A正确，选项B错误。这说明了我的猜测是正确的，存储结构的目的是实现逻辑结构，所以这种目的性使得其不独立于逻辑结构'),(51,'{\"stem\": \"在存储数据时，通常不仅要存储各数据元素的值，而且要存储()\", \"type\": \"single_choice\", \"answer\": \"C\", \"options\": [{\"key\": \"A\", \"value\": \"数据的操作方法\"}, {\"key\": \"B\", \"value\": \"数据元素的类型\"}, {\"key\": \"C\", \"value\": \"数据元素之间的关系\"}, {\"key\": \"D\", \"value\": \"数据的存取方法\"}], \"explanation\": \"\"}',0,1,'# 第一次做此题的理解\n存储要进行元素的值的表示和关系的表示，所以还要存储元素之间的关系，涉及到上面的知识点中的，存储结构涉及到元素的表示和关系的表示'),(52,'{\"stem\": \"一个算法应该具有()等重要特性。\", \"type\": \"single_choice\", \"answer\": \"B\", \"options\": [{\"key\": \"A\", \"value\": \"可维护性、可读性和可行性\"}, {\"key\": \"B\", \"value\": \"可行性、确定性和有穷性\"}, {\"key\": \"C\", \"value\": \"确定性、有穷性和可靠性\"}, {\"key\": \"D\", \"value\": \"可读性、正确性和可行性\"}], \"explanation\": \"一个算法应具有五个重要特性：有穷性、确定性、可行性、输入和输出。选项A、C和D中提到的特性(如可维护性、可读性、可靠性、正确性等)是很重要的，但它们并不是算法定义的重要特性，更多的是关于软件开发中的附加要求。\"}',0,2,''),(53,'{\"stem\": \"下列关于算法的说法中，正确的是（）\", \"type\": \"single_choice\", \"answer\": \"C\", \"options\": [{\"key\": \"A\", \"value\": \"算法的时间效率取决于算法执行所花的CPU时间\"}, {\"key\": \"B\", \"value\": \"在算法设计中不允许用牺牲时间效率的方式来换取好的时间效率\"}, {\"key\": \"C\", \"value\": \"算法必须具备有穷性、确定性等五个特性\"}, {\"key\": \"D\", \"value\": \"通常用时间效率和空间效率来衡量算法的优劣\"}], \"explanation\": \"算法的时间效率是指算法的时间复杂度，即执行算法所需的计算工作量，选项A错误。算法设计会综合考虑时间效率和空间效率两个方面，若某些应用场景对时间效率要求很高，而对空间效率要求不高，则可用牺牲空间效率的方式来换取好的时间效率，选项B错误。评价一个算法的“优劣”不仅要考虑算法的时空效率，还要从正确性、可读性、健壮性等方面来综合评价。\"}',0,3,''),(54,'{\"stem\": \"某算法的时间复杂度为$O(n^2)$，则表示该算法的()\", \"type\": \"single_choice\", \"answer\": \"C\", \"options\": [{\"key\": \"A\", \"value\": \"问题规模是$n^2$\"}, {\"key\": \"B\", \"value\": \"执行时间等于$n^2$\"}, {\"key\": \"C\", \"value\": \"执行时间与$n^2$成正比\"}, {\"key\": \"D\", \"value\": \"问题规模与$n^2$成正比\"}], \"explanation\": \"\"}',0,1,''),(55,'{\"stem\": \"若某算法的空间复杂度为O(1)则表示该算法()\", \"type\": \"single_choice\", \"answer\": \"B\", \"options\": [{\"key\": \"A\", \"value\": \"不需要任何辅助空间\"}, {\"key\": \"B\", \"value\": \"所需辅助空间大小与问题规模n无关\"}, {\"key\": \"C\", \"value\": \"不需要任何空间\"}, {\"key\": \"D\", \"value\": \"所需空间大小与问题规模n无关\"}], \"explanation\": \"\"}',0,1,''),(56,'{\"stem\": \"下列关于时间复杂度的函数中，时间复杂度最小的是()\", \"type\": \"single_choice\", \"answer\": \"D\", \"options\": [{\"key\": \"A\", \"value\": \"$T_1(n)=nlog_2n+5000n$\"}, {\"key\": \"B\", \"value\": \"$T_2(n)=n^2-8000n$\"}, {\"key\": \"C\", \"value\": \"$T_3(n)=nlog_2n-6000n$\"}, {\"key\": \"D\", \"value\": \"$T_4(n)=20000log_2n$\"}], \"explanation\": \"\"}',0,1,''),(57,'{\"stem\": \"下列算法的时间复杂度为（）\\n```c\\nvoid fun(int n){\\n\\tint i=1;\\n\\twhile(i<=n)\\n\\t\\ti=i*2;\\n}\", \"type\": \"single_choice\", \"answer\": \"D\", \"options\": [{\"key\": \"A\", \"value\": \"$O(n)$\"}, {\"key\": \"B\", \"value\": \"$O(n^2)$\"}, {\"key\": \"C\", \"value\": \"$O(nlog_2n)$\"}, {\"key\": \"D\", \"value\": \"$O(log_2n)$\"}], \"explanation\": \"\"}',0,1,''),(58,'{\"stem\": \"下列算法的时间复杂度为（）。\\n```c\\nvoid fun(int n){\\n    int i = 0;\\n    while(i*i*i<=n)\\n        i++;\\n}\\n```\", \"type\": \"single_choice\", \"answer\": \"C\", \"options\": [{\"key\": \"A\", \"value\": \"$O(n)$\"}, {\"key\": \"B\", \"value\": \"$O(nlog_2n)$\"}, {\"key\": \"C\", \"value\": \"$O(\\\\sqrt[3]{n})$\"}, {\"key\": \"D\", \"value\": \"$O(\\\\sqrt{n})$\"}], \"explanation\": \"\"}',0,1,''),(59,'{\"stem\": \"某个程序段如下：\\n```c\\nfor(i = n-1; i>1; i--)\\n    for(j = 1; j < i; j++)\\n        if(A[j] > A[j+1]){\\n              int temp = A[j];\\n              A[j] = A[j+1];\\n              A[j+1] = temp;\\n        }\\n```\\n其中n为正整数，则最后一行语句的频度在最坏情况下是()\", \"type\": \"single_choice\", \"answer\": \"D\", \"options\": [{\"key\": \"A\", \"value\": \"$O(n)$\"}, {\"key\": \"B\", \"value\": \"$O(nlog_2n)$\"}, {\"key\": \"C\", \"value\": \"$O(n^3)$\"}, {\"key\": \"D\", \"value\": \"$O(n^2)$\"}], \"explanation\": \"\"}',0,1,''),(60,'{\"stem\": \"下列程序段的时间复杂度为()\\n```c\\nif(n>=0){\\n    for(int i=0;i<n;i++)\\n        for(int j=0;j<n;j++)\\n            printf(\\\"输入数据大于或等于零\\\\n\\\");\\n}\\nelse{\\n    for(int j=0;j<n;j++)\\n        printf(\\\"输入数据小于零\\\\n\\\");\\n}\\n```\", \"type\": \"single_choice\", \"answer\": \"A\", \"options\": [{\"key\": \"A\", \"value\": \"$O(n^2)$\"}, {\"key\": \"B\", \"value\": \"$O(n)$\"}, {\"key\": \"C\", \"value\": \"$O(1)$\"}, {\"key\": \"D\", \"value\": \"$O(nlog_2n)$\"}], \"explanatio